import { 
  DashboardOutlined, HomeOutlined, WalletOutlined, TeamOutlined, DeploymentUnitOutlined,
} from '@ant-design/icons';
import { APP_PREFIX_PATH } from 'configs/AppConfig'

const dashBoardNavTree = [

{
  key: 'Dashboard',
  path: `${APP_PREFIX_PATH}/dashboard`,
  title: 'Dashboard',
  icon: DashboardOutlined,
  breadcrumb: false,
  submenu: [
		 {
	  key: 'Wallet',
	  path: `${APP_PREFIX_PATH}/dashboard/wallet`,
	  title: 'Wallet',
	  icon: WalletOutlined,
	  breadcrumb: false,
	  submenu: []
	},
	  {
	  key: 'Userlist',
	  path: `${APP_PREFIX_PATH}/dashboard/userlist`,
	  title: 'Userlist',
	  icon: TeamOutlined,
	  breadcrumb: false,
	  submenu: []
	}, 
  ]
},
  {
  key: 'Match',
  path: `${APP_PREFIX_PATH}/match`,
  title: 'Match',
  breadcrumb: false,
  submenu: [
	    {
      key: 'Match',
      path: `${APP_PREFIX_PATH}/match/matchtab`,
      title: 'Match',
      icon: DeploymentUnitOutlined,
      breadcrumb: true,
      submenu: [
        {
          key: 'All Matches',
          path: `${APP_PREFIX_PATH}/match/matchtab/matchlist`,
          title: 'All Matches',
          icon: '',
          breadcrumb: false,
          submenu: []
        },
        {
          key: 'My Match',
          path: `${APP_PREFIX_PATH}/match/matchtab/mymatch`,
          title: 'My Match',
          icon: '',
          breadcrumb: false,
          submenu: []
        }
      ]
    },

  ]
},						  

						 ]

const navigationConfig = [
  ...dashBoardNavTree
]

export default navigationConfig;
